import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";

function Cars({ cars }) {
  return (
    <>
      <Col xs={12} sm={12} md={12} lg={3} xl={3} xxl={3}>
        <section
          style={{
            display: "flex",
            justifyContent: "center",
            marginTop: "25px",
          }}
        >
          <Card style={{ width: "15rem" }}>
            <section
              style={{
                display: "flex",
                justifyContent: "center",
              }}
            >
              <Card.Img
                style={{ width: "150px", height: "200px" }}
                variant="top"
                src={cars.carImg.toString()}
              />
            </section>

            <Card.Body>
              <Card.Title
                style={{
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                {cars.carName}
              </Card.Title>
              <Card.Text
                style={{
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                Category:{cars.carCategory}
              </Card.Text>
              <Card.Text
                style={{
                  display: "flex",
                  justifyContent: "center",
                }}
              >
                Car No.:{cars.carNo.toLocaleUpperCase()}
              </Card.Text>
            </Card.Body>
          </Card>
        </section>
      </Col>
    </>
  );
}
export default Cars;
